    return ( 
        <div className="welcomePage">
            <div className="welcomeImage">
                <img src={WelcomeImage} alt="Welcome Finance Image" />
            </div>
            <div className="welcomeNav">
                
            </div>
        </div>
    );
}

export default Welcome ;
